tory.zip)'),(16,'Market Overview','Sales\r\n','Share Change\r\n','Year On Year or Month on Month change in the Market Share of a drug or drug class\r\n','','(current market share-previous market share)/Previous market share\r\n','Drug,drug class, time period(YoY.YTD.QTD.MTD),geography(state.city.district.territory.zip)'),(17,'Market Access','Sales\r\n','Favorability Index\r\n','Drug Accessibility score across plans. Higher the score , more favorable is the drug in the given plan\r\n','','\r\n','Payor, Geography'),(18,'Market Access','Sales\r\n','Business by channel\r\n','Revenue across various channels like Medicaid, Medicare, Commercial etc.\r\n','','sum(mbs$)\r\n','Payor, Geography'),(19,'Market Access','Sales\r\n','Avg Co-pay\r\n','The average copay across different plans, normalized for 30 days of supply\r\n','','','Payor, Geography'),(20,'Market Access','Sales\r\n','Out of pocket expense\r\n','Amount paid by patients\r\n','','sum(Patient Paid Amount)\r\n','Payor, Geography'),(21,'Market Access','Sales\r\n','Buydown\r\n','Part of copay bought down by Drug Manufactures through coupons \r\n','','Sum( Secondary Planned Pay Amount)\r\n','Payor, Geography\n'),(22,'Market Access','Sales\r\n','Rejection Rate\r\n','Percentage of claims that were rejected out of the total claims(excluding direct feed claims)\r\n','','# Rejected Claims/#Total Claims\r\n','Payor, Geography\n'),(23,'Market Access','Sales\r\n','Reversal Rate\r\n','Percentage of claims that were reversed out of the total claims(excluding direct feed claims)\r\n','','# Reversal Claims/# Total Claims\r\n','Payor, Geography\n'),(24,'Market Access','Sales\r\n','Access/Formulary Advantage\r\n','Ratio of restricted liives for the drug and the competitor\r\n','','Ratio of restricted liives for the drug and the competitor\r\n','Payor, Geography\n'),(25,'Market Access','Sales\r\n','Hospital/Account Coverage\r\n','% of hospitals/accounts and lives intending to include drug in the formulary\r\n','','% of hospitals/accounts and lives intending to include drug in the formulary\r\n','Payor, Geography\n'),(26,'SoB','Sales\r\n','NBRx\r\n','New brand Prescriptions written for drugs\r\n','','TRx count when Source of Business code is New to Brand\n','Drug, Geography, Prescriber Segment\n'),(27,'SoB','Sales\r\n','NBRx Share\r\n','NBRx Market share of a drug or drug class compared to the whole market\n','','Product NBRx/ Market NBRx\r\n','Drug, Geography, Prescriber Segment\n'),(28,'SoB','Sales\r\n','NBRx Change\r\n','Year On Year or Month on Month change in the NBRxs prescribed\r\n','','(CY NBRx Count - PY NBRx Count )/PY NBRx Count\r\n','Drug, Geography, Prescriber Segment\n'),(29,'SoB','Sales\r\n','NBRx Share Change\r\n','Year On Year or Month on Month change in the NBRx Market Share of a drug or drug class\r\n','','(CY NBRx Share - PY NBRx Share )/PY NBRx Share\r\n','Drug, Geography, Prescriber Segment\n'),(30,'SoB','Sales\r\n','Switch To/Switch From\r\n','Total TRxs in which patient either switched to or switched from a particular drug\r\n','','','Drug, Geography, Prescriber Segment\n'),(31,'SoB','Sales\r\n','Add On\r\n','Total TRxs in which a drug was added along with other drugs\r\n','','TRx count when Source of Business code is Add On\r\n','Drug, Geography, Prescriber Segment\n'),(32,'Sales Force Effectiveness','Sales\r\n','Call Plan Achievement\r\n','Actual calls made with respect to Target calls\r\n','','Actual calls Made / Total Planned Calls\r\n','Prescriber Speciality,Drug,drug class,geography(state.city.district.territory.zip)'),(33,'Sales Force Effectiveness','Sales\r\n','Call Plan Adherence\r\n','Adherence to call timelines\r\n','','# Calls made on time / # Calls Made\r\n','Prescriber Speciality,Drug,drug class,geography(state.city.district.territory.zip)'),(34,'Sales Force Effectiveness','Sales\r\n','Reach\r\n','PCPs contacted till date out of total PCPs\r\n','','Contacted PCPs / Total PCPs\r\n','Prescriber Speciality,geography(state.city.district.territory.zip)'),(35,'Sale