ns in Negative Statements','Channel (FB, Blogs), Geography'),(45,'Digital Analytics','Sales\r\n','Social KOLs\r\n','KOLs who have wide presence and following on Social Media','',NULL,'Channel (FB, Blogs), Geography'),(46,'Marketing','Sales\r\n','KOL Perception\r\n','% of KOLs that are advocating the drug','','# of KOLs advocating the drug/# of total KOLs','Prescriber Specialty, Geaography'),(47,'Marketing','Sales\r\n','KOL Reach\r\n','% of the KOLs who have been reached','','# of KOLs received a call/# of total KOLs','Prescriber Specialty, Geaography'),(48,'Marketing','Sales\r\n','KOL Frequency\r\n','# of calls per KOL','','# of calls to KOLs/# of KOLs','Prescriber Specialty, Geaography'),(49,'RWE','Sales\r\n','Effectiveness Score\r\n','A score ranging from 1-10 that quantifies the effectives of a therapy leveraging the lab test result\r\n','','(lab test result at the end of tracking period-lab test result at the beginning of tracking period)/expected range\r\n','Demographics (Age, Gender, Ethnicity, Geography)'),(50,'RWE','Sales\r\n','Adverse Event Score\r\n','A score ranging from 1-10 that quantifies the adverse events of a therapy\r\n','','(number of adverse events(each adverse event having a different weightage) at the end of tracking period-number of adverse events(each adverse event having a different weightage) at the beginning  of tracking period)/expected range\r\n','Demographics (Age, Gender, Ethnicity, Geography)'),(51,'RWE','Sales\r\n','Adherence Score\r\n','A score ranging from 1-10 that quantifies the adherence to a therapy\r\n','',NULL,'Demographics (Age, Gender, Ethnicity, Geography)'),(52,'RWE','Sales\r\n','Untreated Population\r\n','Total patient population which is suffering from a given disease but is not being treated\r\n','','count(distinct(patient_id)) where treat=\'No Treatment\'\r\n','Demographics (Age, Gender, Ethnicity, Geography)'),(53,'RWE','Sales\r\n','Prevalence of Disease \r\n','Existence of a given disease among the universal patient